:如今,没结婚的像结婚的一样同居,
结婚的像没有结婚的一样分居;
动物像人一样穿着衣服,
人像动物一样露着肉;
小孩子像大人一样成熟,
大人像小孩子一样幼稚;
女人像男人一样爷们,
男人像女人一样娘们;
没钱的像有钱的一样装富,
有钱像没钱的一样装穷;
情人像夫人一样四处招摇,
夫人像情人一样深入简出。。

